import React from 'react';
import {CssBaseline, Container } from '@material-ui/core'

class Main extends React.Component {
  render() {
    return (
      <>
        <div>
          <div>
            <svg><rect /></svg>
            <div>
              <div>
                <h1></h1>
                <p></p>
              </div>
            </div>
          </div>
        </div>
      </>
    );
  }
}

export default Main;
